export class Graph {
    constructor() {
        this.adj = new Map();
        this.nodes = [];
        this.edges = [];
        this.v = 1;
    }
    addNode() {
        node = {id: v, color: 'black'}
        this.nodes.push(node);
        this.adj.set(this.v++, node);
    }
};
